import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open a product detail modal to add to cart (simulate user clicking on a product card)
    // Use a product card by text (e.g., "Apple iPhone 15 Pro Max")
    await page.waitForSelector('text=Apple iPhone 15 Pro Max', { timeout: 5000 });
    await page.click('text=Apple iPhone 15 Pro Max');

    // Wait for modal to appear (look for product detail modal by a unique heading)
    await page.waitForSelector('.product-detail-title', { timeout: 5000 });

    // Set quantity to 3 (change the <select id="quantity">)
    await page.waitForSelector('select#quantity', { timeout: 5000 });
    await page.selectOption('select#quantity', '3');

    // Take screenshot after selecting quantity
    const step2 = path.join(screenshotsDir, 'step_2_quantity_selected.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click "Add to Cart" button (use button text and class)
    await page.waitForSelector('.add-to-cart.large', { timeout: 5000 });
    await page.click('.add-to-cart.large');

    // Wait for notification to appear (look for .notification.success)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    const step3 = path.join(screenshotsDir, 'step_3_added_to_cart.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Open cart modal (click on the cart icon or cart count)
    // Use the cart count by its text (should be updated to 3)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear (look for cart modal heading)
    await page.waitForSelector('text=Your Cart', { timeout: 5000 }).catch(() => {}); // fallback if heading not present
    await page.waitForSelector('#cartItems', { timeout: 5000 });

    // Find the quantity for the iPhone in the cart (extract from cart item)
    const cartItemSelector = '.cart-item:has-text("Apple iPhone 15 Pro Max")';
    await page.waitForSelector(cartItemSelector, { timeout: 5000 });

    // Extract quantity value from the cart item
    const quantityText = await page.$eval(`${cartItemSelector} .quantity`, el => el.textContent.trim());

    // Take screenshot of cart modal
    const step4 = path.join(screenshotsDir, 'step_4_cart_modal.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    return {
      success: true,
      action: "Updated cart item quantity to 3 for 'Apple iPhone 15 Pro Max' and verified in cart modal",
      extractedData: {
        product: "Apple iPhone 15 Pro Max",
        quantityInCart: quantityText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
